
UPDATE `RA_TNT_APP_PARAMS` SET `ATTR_VALUE` = 'SELECT t1.SELR_PROP_ID_VC_NN, t1.RBID_PROP_ID_VC_PK, t2.RBID_PROP_ID_VC_FK, t1.REO_PROP_STTS_VC , t1.PROP_SOLD_DATE_DT, t1.PROP_STTS_ID_VC_FK, t2.RBID_PROP_ID_VC_FK, t2.RBID_PROP_LIST_ID_VC_PK, t2.LIST_TYPE_ID_VC_FK, t2.LIST_PRCE_NT, t2.LIST_STRT_DATE_DT_NN, t2.LIST_END_DATE_DT_NN, t2.LIST_STTS_DTLS_VC, t2.OCCPNCY_STTS_AT_LST_CREATN FROM RRRBPMMS_PROP t1 JOIN RRRBPMTX_PROP_LIST t2 ON t1.RBID_PROP_ID_VC_PK = t2.RBID_PROP_ID_VC_FK JOIN (SELECT t3.RBID_PROP_ID_VC_FK, MAX(TO_DATE(t3.LIST_STRT_DATE_DT_NN)) as LIST_STRT_DATE_DT_NN FROM RRRBPMTX_PROP_LIST t3 WHERE TO_DATE(t3.LIST_STRT_DATE_DT_NN) BETWEEN TO_DATE(?) AND TO_DATE(?) AND t3.LIST_STTS_DTLS_VC NOT IN (\'CANCELLED\',\'DISAPPROVED\') GROUP BY t3.RBID_PROP_ID_VC_FK) t4 ON t2.RBID_PROP_ID_VC_FK = t4.RBID_PROP_ID_VC_FK AND TO_TIMESTAMP(t2.LIST_STRT_DATE_DT_NN, \'DD-Mon-RR\') = TO_TIMESTAMP(t4.LIST_STRT_DATE_DT_NN, \'DD-Mon-RR\') WHERE TO_DATE(t2.LIST_STRT_DATE_DT_NN) BETWEEN TO_DATE(?) AND TO_DATE(?) AND t2.LIST_STTS_DTLS_VC NOT IN (\'CANCELLED\',\'DISAPPROVED\') AND t2.OCCPNCY_STTS_AT_LST_CREATN <> \'Y\'' WHERE `ATTR_KEY` = 'hubzu.daily.qa.report';
